class Solution {
    func checkStrings(_ s1: String, _ s2: String) -> Bool {
        var evenCounts1 = [Character: Int]()
        var oddCounts1 = [Character: Int]()
        var evenCounts2 = [Character: Int]()
        var oddCounts2 = [Character: Int]()

        for (index, char) in s1.enumerated() {
            if index % 2 == 0 {
                evenCounts1[char, default: 0] += 1
            } else {
                oddCounts1[char, default: 0] += 1
            }
        }

        for (index, char) in s2.enumerated() {
            if index % 2 == 0 {
                evenCounts2[char, default: 0] += 1
            } else {
                oddCounts2[char, default: 0] += 1
            }
        }

        return evenCounts1 == evenCounts2 && oddCounts1 == oddCounts2
    }
}
